descript.abstract:
2020 Census Tract polygons for all of Pierce County, realigned to Pierce County roads, parcels, hydro, railroads, powerlines, etc. Population figures for race, ethnicity, median age, household size, household count, etc were downloaded from the US Census website and joined to this layer. Please read metadata for additional information (https://matterhorn.co.pierce.wa.us/GISmetadata/pdbis_census2020_tracts.html
). Any data download constitutes acceptance of the Terms of Use (https://matterhorn.co.pierce.wa.us/Disclaimer/PierceCountyGISDataTermsofUse.pdf).

